  createWithEqualityFn<Store>(
    yjsMiddleware<Store>(doc, 'shared', (set) => ({
      count: 0,
      text: '',
      users: [],
      increment: () =>
        set((state) => ({
          ...state,
          count: state.count + 1,
        })),
      updateText: (text) => set((state) => ({ ...state, text })),
    })),
    isEqual,
  );

export const { useStore, Provider } = createContext<StoreApi<Store>>();
